import { useHistory } from "react-router-dom";
import { Box, Button, TextField } from "@mui/material";
import { Formik } from "formik";

const modalStyle = {
  position: "absolute",
  top: "50%",
  left: "50%",
  //   textAlign: "center",
  transform: "translate(-50%, -50%)",
  width: "80%",
  maxWidth: "500px",
  bgcolor: "background.paper",
  border: "2px solid #000",
  boxShadow: 24,
  p: 4,
  borderRadius: "10px",
};

const LoginForm = (props) => {
  //   const history = useHistory();
  // const handleClose = () => history.push('/welcome');
  return (
    <Box sx={modalStyle}>
      <Formik
        initialValues={{
          email: "foo@example.com",
          password: "password",
        }}
      >
        {({ errors, values }) => (
          <form noValidate 
        //   onSubmit={handleSubmit}
          >
            <TextField
              fullWidth
              label="Email Address"
              margin="normal"
              name="email"
              type="email"
              variant="outlined"
              value={values.email}
            >
              Email
            </TextField>
            <TextField
              fullWidth
              label="Password"
              margin="normal"
              name="password"
              type="password"
              variant="outlined"
              value={values.password}
            >
              Password
            </TextField>
            <Button
              color="primary"
              fullWidth
              size="large"
              variant="contained"
              type="submit"
            >
              Log In
            </Button>
          </form>
        )}
      </Formik>
    </Box>
  );
};

export default LoginForm;
